import React, { useState } from 'react';
import HomePage from './components/HomePage';
import UserPage from './components/UserPage';

const App = () => {
  const [page, setPage] = useState(false);

  const handleClick = () => {
    setPage(true);
  };

  return (
    <div>
      {page ? <UserPage /> : <HomePage />}
      <HomePage handleClick={handleClick} />
    </div>
  );
};

export default App;
